import styled from "styled-components";

const StyledRoomTitle = styled.div`
  padding-left: 0.1em;
  display: flex;
  flex-direction: row;
  justify-content: start;
  align-items: center;
  background-color: #e0e0e0;
  margin-bottom: 0.2em;
`;
export default StyledRoomTitle;
